import React, { useState } from "react";
import { Form } from "antd";

const LoginForm = () => {
  const [id, setId] = useState("");
  const [pw, setPw] = useState("");
  return (
    <>
      <Form>
        <div>
          <label htmlFor="user-id">ID</label>
          <br />
          <input
            name="user-id"
            value={id}
            onChange={onChangeId}
            required
          ></input>
        </div>
        <div>
          <label htmlFor="user-pw">PW</label>
          <br />
          <input
            name="user-pw"
            value={password}
            onChange={onChangeId}
            required
          ></input>
        </div>
        <div></div>
        <div></div>
      </Form>
    </>
  );
};

export default LoginForm;
